- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of your
    letter dated, April 10, 2009, referencing the 2009 Amended October Monthly Report.
    \ The Committee?s response is as follows:    1. The excessive portion of the contribution
    from Gerald Vento was refunded on 04/22/09.  2. The contribution from AT&T was
    an offset and is now correctly disclosed on Schedule A, Line 15.  The in-kind
    contributions from Avicom were reported under the incorrect donor name.  The in-kind
    contributions have been amended to correctly report from Obama for America.  3.
    The interest receipt originally disclosed on Schedule A was reported in error.
    \ This receipt has been removed  4. The transfers from Obama for America have
    been correctly reported on Line 12.  5. The donor name IUPAT has been amended
    to correctly identify the Committee.  6. The expenditures listed on Schedule B
    were not made on behalf of a specifically identified federal candidate.  The event
    related expenses were corrected to now report on Line 30b.  These expenses were
    for generic rallies and GOTV rallies and were not made on behalf of a specifically
    identified federal candidate.  7. The purpose descriptions for Consulting Fees/Day
    Workers, Consulting/Communications, Consulting Fees/Field Director have been corrected
    to more specific purpose descriptions  8. List Purchase expenses are now correctly
    reporting on Line 30b.  The Canvassing expenses were not public communications
    nor met the definition of FEA so therefore were correctly reported on Line 21b.
    \ 9. The expenses reported on Schedule B, Line 21 for Consulting/Communication,
    Postage, Print Advertising, Printing, Printing/Copying, Printing/Shipping, Printing
    Expense, Telecommunications, and Telephone Calls have been amended to provide
    more detailed purpose codes.  In addition, none of these expenses were public
    communications nor met the definition of FEA so therefore were correctly reported
    on Line 21b.  10. The purpose code for Literature has been amended to provide
    a more detailed description.  In addition, none of these expenses were public
    communications nor met the definition of FEA so therefore were correctly reported
    on Line 21b.  11. Please note that expenses listed on Line 30b, including those
    for Direct/Mail Early Vote and Literature, were not expressed advocacy and were,
    therefore, correctly reported on Line 30b.  12. None of the transfer-in funds
    from the DCCC or DNC were used in the purchase of exempt materials.  13. In regards
    to payroll and related expenses listed on Schedule H4: none of the employees spent
    more than 25% of their time on FEA activity nor in connection with a Federal election.
    \ 14. The payments listed on Schedule H4 for Printing, Printing/Graphics, Telecommunications,
    Telephone/Communications and Telephone Calls have been more clearly described
    and were administrative expenses.  None of the expenses reported on Schedule H4
